import React from 'react'

const categories = [
  "Dogs",
  "Cats",
  "Jokes",
  "Inspiration"
]

const Nav = () => {
  return (
    <nav className='w-auto'>
      <ul className='flex m-auto justify-center'>
        {categories.map((category, id ) => {
          <li className='text-lg  text-gray-500' key={id}>{category}</li>
        })}
      </ul>
    </nav>
  )
}

export default Nav
